import React from 'react'

export default function Login() {
    let history = useHistory()
    let home = () => {
        history.push('/home')
    }
    return <>
    <div style = {{display: 'grid' , placeItems : 'center'}}>
        Welcome Back
    </div>
    <button style = {{padding: '1%', background: 'lightblue'}} onClick = {home}>Home</button>
    </>
}
